import React from 'react';

function About() {
    return (
      <div>
        <header>
            From one audiophile to another:

            Audiofile is an all-in-one platform that lets you build and customize an online vinyl library that's tailor-made for you.  Whether you want only basic details or a library that tracks everything about each album, we've got you covered.

            Why Audiofile?

            Audiofile is by vinyl-lovers for vinyl-lovers.  Everything about our platform is designed to be something that we ourselves would love to use.  That means our users are getting a truly intentional and meticulously designed experience.
        </header>
      </div>
    );
  }

  export default About;
